import ReactDOM from "react-dom";





const SearchPanel = () => {
  return <input placeholder="search" />;
};
const App = () => {

  return (
  <div>
    <AppHeader />
    <SearchPanel />
    <TodoList />
  </div>
);};


ReactDOM.render(<App />, document.getElementById("root"));
